.Skin {
    font-family: "IBM Plex Sans JP", sans-serif !important;
}

.Skin #SkinContent {
    background-image: url("https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_XG2rQXBMamUhyok"),
