  .Skin #QID2 label.SingleAnswer > span::before,
  .Skin #QID2 label.SingleAnswer.q-checked > span::before   {
      opacity : 0;
  }

/* 初級*/
.Skin .MC .SAVR  span.LabelWrapper #QID2-4-label {
    width: 100%;    
    background: url(https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_qX8xkXarwRYl5oe) no-repeat center bottom /contain !important;
    padding: 40px 0 20px 0;
    margin: 0 auto !important;
    color: #00000000;
/*    opacity: 1; 
    transition: opacity 0.5s ease;*/
}

/* 中級 */
.Skin .MC .SAVR  span.LabelWrapper #QID2-5-label {
    width: 100%;    
    background: url(https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_lEZnkegCe46zpu1) no-repeat center bottom /contain !important;
    padding: 40px 0 20px 0;
    margin: 0 auto !important;
    color: #00000000;
}
/* 上級 */
.Skin .MC .SAVR  span.LabelWrapper #QID2-6-label {
    width: 100%;    
    background: url(https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_GSSa2xv1iozIOZX) no-repeat center bottom /contain !important;
    padding: 40px 0 20px 0;
    margin: 0 auto !important;
    color: #00000000;
}

/* 難易度調整時の効果 */
.Skin #QID2 label.SingleAnswer.q-checked::after {
  content: "";
  position: absolute;
  z-index: 2;
  width: 100%;
  height:100%;
  top: 0;
  left: 0;
  background-color: white;
  opacity: 0.5;
}

