/*** 回答ページ ***/

/*回答マーク*/
.Skin label.SingleAnswer > span::before {
  width: 16px !important;
  height: 24px !important;
}

.Skin label.SingleAnswer.q-checked > span::before,
.Skin label.SingleAnswer.q-checked.q-focused > span::before {
  width: 16px !important;
  height: 24px !important;
  border: 2px solid #000000 !important;
  background: #000 ;
  box-shadow: none !important;
}


/*** その他 ***/

/* ボタン位置 */
.Skin #Buttons {
  display: flex;
  justify-content: center;
}

.Skin #NextButton {
    margin-bottom: 15px !important;
    font-family: 'IBM Plex Sans JP' !important;
    font-size: 18px !important;
    font-weight: 100 !important;
    font-style: italic !important;
    color: white !important;
    letter-spacing: 4px !important;
    background: linear-gradient(90deg, #ff7600 0, #f39800 50%, #ff7600 100%);;
    position: relative;
}

.Skin #NextButton::before {
  content: "";
  position: absolute;
  top: 10px;  /* 枠線の位置を上下左右に10pxずつずらす */
  left: 10px;
  right: 10px;
  bottom: 10px;
  border: 2px solid #000 !important; /* 枠線の色と太さ */
  z-index: -1;
}

/* ふったーなど */
.Skin #Footer,
.Skin #BrandingFooter {
    font-size: 14px !important;
    font-family: 'IBM Plex Sans JP' !important;
    font-weight: 100 !important;
    max-width: initial !important;
    background: url("https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_S1da711lhHYZnKp") no-repeat right top /200px,
                        linear-gradient(-90deg,rgba(255,118,0,.9) 0,rgba(243,152,0,.9) 100%),
                        url("https://survey.bandainamcoent.co.jp/ControlPanel/Graphic.php?IM=IM_qDc2laLJLKN0Sgu") no-repeat center 60% /cover !important;
    padding-top: 40px !important;
    border-radius: 0 40px 0 0;
}

.Skin #PushStickyFooter {
    max-width: initial !important;
    height: 0px !important;
    background: linear-gradient(-90deg,rgba(255,118,0,.95) 0,rgba(243,152,0,.9) 100%) !important;
}

.Skin .EndOfSurvey {
  padding: 20px 5px !important;
}


